import './NewPass.style.css';

import Navigation from '../../components/Navigation/Navigation.component';
import { useState } from 'react';

const NewPassComp = () => {
  const [passTitle, setPassTitle] = useState();
  const [password, setPassword] = useState();
  const [confirmPassword, setConfirmPassword] = useState();

  const onHandleSubmit = () => {
    try {
      if(password === confirmPassword) {
        axios.post('/new-cipher-pass', {
          title: passTitle,
          cipherPassword: password,
        });
      }
    } catch (error) {

    }
  };

  return (
    <div>
      <Navigation />
      <div className='NewPassComp'>
        <form action={onHandleSubmit}>
          <div>
            <input
              type='text'
              name=''
              id=''
              placeholder='Password Title'
              className='input-newpass'
              onChange={(e) => {
                setPassTitle(e.target.value);
              }}
            />
            <input
              type='password'
              placeholder='Enter Password'
              name=''
              id=''
              className='input-newpass'
              onChange={(e) => {
                setPassword(e.target.value);
              }}
            />
            <input
              type='password'
              placeholder='Confirm Password'
              name=''
              id=''
              className='input-newpass'
              onChange={(e) => {
                setConfirmPassword(e.target.value);
              }}
            />
          </div>
        </form>
        <button>Button</button>
      </div>
    </div>
  );
};

export default NewPassComp;
